import React, { useState } from 'react';
import './style.css'
import './style-verificator.css'

function ProgrammerPage({ bugs, onDeleteBug }) {
  const [searchTerm, setSearchTerm] = useState('');

  const handleDeleteBug = (bugId) => {
    onDeleteBug(bugId);
  };

  const handleSearchChange = (event) => {
    setSearchTerm(event.target.value);
  }

  const filteredBugs = bugs.filter((bug) =>
    bug.urgency.toLowerCase().includes(searchTerm.toLowerCase())
  );

  return (
    <div className='container-programmer'>
      <h2>Bug List</h2>
      <input
        type="text"
        placeholder="Search by urgency level"
        value={searchTerm}
        onChange={handleSearchChange}
      />
      <div>
      <ul>
        {filteredBugs.map((bug) => (
          <li key={bug.id}>
            <div className='bug-container'>
              <strong>Title:{bug.title}</strong>
              <p><strong>Description:</strong>{bug.description}</p>
              <p><strong>Date:</strong> {bug.date}</p>
              <p><strong>Urgency:</strong> {bug.urgency}</p>
              <button onClick={() => handleDeleteBug(bug.id)}>Bug rezolvat</button>
            </div>
          </li>
        ))}
      </ul>
      </div>
    </div>
  );
}

export default ProgrammerPage;
